import React,{Component} from 'react';

export class Todo extends Component {

    constructor(props) {
        super(props);
    }   

    render() {
        return ( 
            <div>
                <p>Texto: {this.props.text}</p>
                <p>Prioridad: {this.props.priority}</p> 
                <a>Fecha: {this.props.dueDate}</a>
            </div> 
        );
    }
}
export default Todo;
